function App() {
  const [loaded, setLoaded] = useState(false);

  useEffect(() => {
    let timer = setTimeout(() => setLoaded(true), 2000);
    return () => {
      clearTimeout(timer);
    };
  }, []);

  return (
    <div>
      {!loaded ? (
        <div className="flex w-full mt-52 justify-center">
          <Loader />
        </div>
      ) : (
        <div>
          <Navbar />          

          <Footer />
        </div>
      )}
    </div>
  );
}

export default App;
